/*
* Implement strStr().
* Return the index of the first occurrence of needle in haystack, or -1 if needle is not part of haystack.
* Clarification:
* What should we return when needle is an empty string? This is a great question to ask during an interview.
* For the purpose of this problem, we will return 0 when needle is an empty string. This is consistent to C's strstr() and Java's indexOf().
*
* Example 1:
* Input: haystack = "hello", needle = "ll"
* Output: 2
*
* Example 2:
* Input: haystack = "aaaaa", needle = "bba"
* Output: -1
*
* Example 3:
* Input: haystack = "", needle = ""
* Output: 0
*
* Constraints:
* 0 <= haystack.length, needle.length <= 5 * 104
* haystack and needle consist of only lower-case English characters.
*
*/
package com.leetcode.practice;

import java.util.Arrays;
import java.util.Collections;
import java.util.List;
import java.util.stream.Collectors;

public class ImplementstrStr {


    public static int strStr(String haystack, String needle) {
        if(needle== null || needle.length() == 0)
            return 0;

        if(needle.length() > haystack.length())
            return -1;

        int result = -1;
        for(int i = 0; i < haystack.length(); i++){
            int start = 0;
            if(haystack.charAt(i) == needle.charAt(start)){
                result = i;
                while(start+1<needle.length() && i+1 < haystack.length() && haystack.charAt(i+1) == needle.charAt(start+1)){
                    i = i+1;
                    start = start+1;
                }
                if(start == needle.length()-1){
                    break;
                } else if(i>0 && i+1 < haystack.length() && haystack.charAt(i-1) == needle.charAt(0)) {
                    //i = i-1;
                    result = -1;
                } else{
                    i = i-start;
                    result = -1;
                }
            }
        }
        return result;
    }

    public static int strStr1(String haystack, String needle){
        if(needle== null || needle.length() == 0)
            return 0;
        int result = -1;
        for(int i = 0; i < haystack.length(); i++){
            if(haystack.substring(i).length() < needle.length())
                return -1;

            int start = 0;

            while(haystack.charAt(i) != needle.charAt(0)){
                i++;
            }
            if(haystack.charAt(i) == needle.charAt(start)){
                result = i;

                while(haystack.charAt(i) != needle.charAt(0))

                while (start+1<needle.length() && i+1<haystack.length() && haystack.charAt(i+1) == needle.charAt(start+1)){
                    start++;
                    i++;
                }
                if(start == needle.length()-1){
                    break;
                } else {
                    i = i-start;
                    result = -1;
                }
            }
        }
        return result;
    }

    public static void main(String[] args) {
        System.out.println(strStr1("hello", "ll"));
        System.out.println(strStr1("aaaaa", "bba"));
        System.out.println(strStr1("aaa", "a"));
        System.out.println(strStr1("", ""));
        System.out.println(strStr1("aaa", "aaaa"));
        System.out.println(strStr1("", "a"));
        System.out.println(strStr1("mississippi", "issip"));
        System.out.println(strStr1("mississippi", "issipi"));
        System.out.println(strStr1("", ""));
        System.out.println(strStr1("mississippi", "pi"));
        System.out.println(strStr1("aabaaabaaac", "aabaaac"));
        System.out.println(strStr1("", ""));
    }
}
